		"text": "You can be a paradox.\n\nYou can sound confident and have anxiety. \n\nYou can speak in public and be a wreck. \n\nYou can look tough and cry.\n\nYou can be attractive and feel abhorrent.\n\nYou can have everything and feel nothing.\n\nYou can know there is no hope, and there be hope."
